import React from 'react';

type props = {
  type: 'submit';
  title: string;
  onClick?: () => void;
};

export const Button = (props: props) => {
  const { type, title, onClick } = props;

  return (
    <button type={type} onClick={onClick}>
      {title}
    </button>
  );
};
